import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './containers/Home';

const Router = () => {
    return (
        <>
            <Routes>
                <Home />
                <Route exact path={'/'} component={Home} />
            </Routes>
        </>
    );
};
export default Router;
